import { StyleSheet } from "react-native";

const categoriesStyles = StyleSheet.create({
    category: {
        backgroundColor: "#323645",
        marginVertical: 15,
        borderRadius: 5,
        color: "#ffffff",
        paddingHorizontal: 15,
        paddingVertical: 10
    }
});

export default categoriesStyles;
